import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

import { Provider } from 'react-redux'
import { createStore } from 'redux'
import addToCartReducer from './reducers/index'

import 'bootstrap/dist/css/bootstrap.css';

console.log("IN INDEX FILE, addToCard Reducer", addToCartReducer)

const store = createStore(addToCartReducer)

store.subscribe(() => console.log("IN INDEX FILE STORE.GETSTATE LOG",store.getState()))

store.dispatch({type: 'ADD_TO_CART'})

ReactDOM.render(
    <Provider store={store}>
        <App />
    </Provider>, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();
